import React, { useEffect, useState } from 'react';
import axios from 'axios';

const BettingOdds = () => {
  const [odds, setOdds] = useState([]);

  useEffect(() => {
    const fetchOdds = async () => {
      const response = await axios.get('http://127.0.0.1:5000/betting-odds');
      setOdds(response.data);
    };

    fetchOdds();
  }, []);

  return (
    <div>
      <h2>Betting Odds</h2>
      <table>
        <thead>
          <tr>
            <th>Date</th>
            <th>Donald Trump</th>
            <th>Kamala Harris</th>
            <th>Other</th>
          </tr>
        </thead>
        <tbody>
          {odds.map((item, index) => (
            <tr key={index}>
              <td>{item.date}</td>
              <td>{(item['Donald Trump'] * 100).toFixed(2)}%</td>
              <td>{(item['Kamala Harris'] * 100).toFixed(2)}%</td>
              <td>{(item['Other'] * 100).toFixed(2)}%</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default BettingOdds;
